import React, { useEffect } from 'react';
import { useSelector, useDispatch } from "react-redux";
import { withCookies } from "react-cookie";
import { Link } from 'react-router-dom';

import {
    selectPDF_list,
    fetchAsyncPDFGet,
} from "./reportSlice";
import Search_bar from './Search_bar';

const Report = (props) => {
    const dispatch = useDispatch();
    const token = props.cookies.get("current-token");
    const pdf_list = useSelector(selectPDF_list);

    useEffect(() => {
        dispatch(fetchAsyncPDFGet(token))
    }, [dispatch]);

    return (
        <div>
            <div>
                <Search_bar />

            </div>
            <div>
                {pdf_list.map((pdf) => (
                    <Link key={pdf.id} to={`/report/${pdf.company_number}/`} style={{ textDecoration: 'none', color: '#424242' }}>
                        {pdf.company_name} {pdf.company_number} 
                    </Link>
                ))}
            </div>
        </div>
    )
}

export default withCookies(Report)
